import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';
import InputLabel from '@material-ui/core/InputLabel';
import MenuItem from '@material-ui/core/MenuItem';
import FormHelperText from '@material-ui/core/FormHelperText';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';
import './styles/form.scss';
// import Footer from '../src/Footer';

const useStyles = makeStyles((theme) => ({
  root: {
    '& .MuiTextField-root': {
      //label: 
    },
  },
  textField: {
    marginLeft: theme.spacing(1),
    marginRight: theme.spacing(1),
    width: '25ch',
  },
}));
//像 class 一樣可存在多個於js檔裡
//適合客製化 / 增加不同元素
export function Header2() {
  return(
    <div>
      <h2>Header 2</h2>
    </div>
  )
}
//什麼都不講的狀況下會選 default 引入，像 id 一樣只能存在一個於js檔裡
//適合做基礎樣式
export default function Header1() {
  const classes = useStyles();
  const [CountryCode, setCountryCode] = React.useState('');

  const handleChange = (event) => {
    setCountryCode(event.target.value);
  };
  return (
    <div className="container">
      <div className="intro">
        <h2 className="title">Welcome to Sygna Bridge VASP Registration</h2>
      </div>
      <form id="registration_form">
          <div class="input-field">
            <h5>Email Address</h5>
            <TextField
              id="standard-full-width"
              label="Your valid email address."
              placeholder="Input mail address"
              InputLabelProps={{
                shrink: true,
              }}
            />
          </div>
          <div class="input-field">
            <h5>Country Code</h5>
            <FormControl variant="outlined" className={classes.formControl}>
              <InputLabel shrink id="demo-simple-select-outlined-label">Select</InputLabel>
              <Select
                labelId="demo-simple-select-outlined-label"
                id="demo-simple-select-outlined"
                value={CountryCode}
                onChange={handleChange}
                displayEmpty
                className={classes.selectEmpty}
              >
                <MenuItem value="">
                  <em>Select</em>
                </MenuItem>
                <MenuItem value={10}>Ten</MenuItem>
                <MenuItem value={20}>Twenty</MenuItem>
                <MenuItem value={30}>Thirty</MenuItem>
              </Select>
            </FormControl>
          </div>
      </form>
    </div>
  );
}
